        {
            var fg = new FileGeneration();
            ToString(fg);
            return fg.ToString();
        }

        public override void ToString(FileGeneration fg)
        {
            fg.AppendLine("GlobalShort_ErrorMask =>");
            fg.AppendLine("[");
            using (new DepthWrapper(fg))
            {
                if (this.Overall != null)
                {
                    fg.AppendLine("Overall =>");
                    fg.AppendLine("[");
                    using (new DepthWrapper(fg))
                    {
                        fg.AppendLine($"{this.Overall}");
                    }
                    fg.AppendLine("]");
                }
                ToString_FillInternal(fg);
            }
            fg.AppendLine("]");
        }
        protected override void ToString_FillInternal(FileGeneration fg)
        {
            base.ToString_FillInternal(fg);
            fg.AppendLine($"Data => {Data}");
        }
        #endregion

        #region Combine
        public GlobalShort_ErrorMask Combine(GlobalShort_ErrorMask rhs)
        {
            var ret = new GlobalShort_ErrorMask();
            ret.Data = this.Data.Combine(rhs.Data);
            return ret;
        }
        public static GlobalShort_ErrorMask Combine(GlobalShort_ErrorMask lhs, GlobalShort_ErrorMask rhs)
        {
            if (lhs != null && rhs != null) return lhs.Combine(rhs);
            return lhs ?? rhs;
        }
        #endregion

        #region Factory
        public static GlobalShort_ErrorMask Factory(ErrorMaskBuilder errorMask)
        {
            if (errorMask?.Empty ?? true) return null;
            return new GlobalShort_ErrorMask();
        }
        #endregion

